   )
}


export const Products = () => {

 return (
    <Container>
       <Row>
          <Col style={{width: 200}}>
            <Sidebar></Sidebar>
          </Col>
          <Col>
            <h2>Products</h2>
            <Table></Table>
          </Col>
      </Row>
    </Container>
 );
};
